import React, { Component } from 'react';
import './App.css';
import API from "./utils/API"



class App extends Component {
  state = {
    employees: ""
  };
  componentDidMount() {
    API.getRandomEmployees()
      .then(res => console.log(res))
      .catch(err => console.log(err));
  }


}

export default App;
